import styled from 'styled-components';

export const Label = styled.label`
  color: #444;
  font-weight: bold;
  text-align: left;
  display: block;
  margin-bottom: 9px;
`;

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
`;
